import React from "react";
import { Slide } from "react-slideshow-image";
import "./Slider.css";

const properties = {
  duration: 5000,
  transitionDuration: 500,
  infinite: true,
  indicators: true,
  arrows: true,
};

function Slideshow () {
  return (
    <Slide {...properties}>
      <img className="home_image" src="https://images-eu.ssl-images-amazon.com/images/G/31/img17/AmazonDevices/2019/Herotator/GW-Dec/FTV_PC-GW-hero_1500x600_1x._CB446558100_.jpg" alt="" />
      <img className="home_image" src="https://images-eu.ssl-images-amazon.com/images/G/31/img17/AmazonDevices/2019/Herotator/GW-Dec/FTV_PC-GW-hero_1500x600_1x._CB446558100_.jpg" alt="" />
    </Slide>
  );
}

export default Slider;
